void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}
int posX = 10; 
int endPosX = 39;
int posY = 180;
bool gameNotOver = true;
bool isSecondStage = false;
int first = 320;
int goombaPosX = 150;
int goomba1Dir = 1;
bool goomba1Kill = false;
bool eraseG1 = false;
bool displayEnd = true;
bool isThirdStage = false;
bool isFirstStage = true;
int goombaPosX2 = 150;
int goomba2Dir = 1;
bool goomba2Kill = false;
bool eraseG2 = false;
int goombaPosX3 = 250;
int goomba3Dir = 1;
bool goomba3Kill = false;
bool eraseG3 = false;
int goombaPosX4 = 160;
int goomba4Dir = 1;
bool goomba4Kill = false;
bool eraseG4 = false;
bool isFourthStage = false;
bool gameWon = false;
int main(void){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;
    makeBlue();
	makeSign();
	makePlatform();
	drawMario();
	drawHill();
	unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
	
  	volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

	int PS2_data, RVALID;
	short int pressedKey; 
	
	while (1) {
		PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
		RVALID = (PS2_data & 0x8000);	// extract the RVALID field
		if (RVALID != 0)
		{
			/* always save the last three bytes received */
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
		}
		if(endPosX >= 320 && isFirstStage){
			secondStage();
			endPosX = 39;
			posX = 10;
			isSecondStage = true; 
			isFirstStage = false;
		}
		if(endPosX >= 320 && isSecondStage){
			thirdStage();
			endPosX = 39;
			posX = 10;
			isThirdStage = true; 
			isSecondStage = false;
		}
		if(endPosX >= 320 && isThirdStage){
			fourthStage();
			endPosX = 39;
			posX = 10;
			isFourthStage = true;
			isThirdStage = false;
		}
		if(endPosX >= 200 && isFourthStage){
			endPosX = 39;
			posX = 10;
			isFourthStage = false;
			gameWon = true;
		}

		if (gameWon){
			win();
			break;
		}
		if (isSecondStage && (posX == goombaPosX || goombaPosX == endPosX) && posY >= 170 && !goomba1Kill){
			gameNotOver = false;
		}
		if (isThirdStage && (posX == goombaPosX2 || goombaPosX2 == endPosX) && posY >= 170 && !goomba2Kill){
			gameNotOver = false;
		}
		if (isThirdStage && (posX == goombaPosX3 || goombaPosX3 == endPosX) && posY >= 170 && !goomba3Kill){
			gameNotOver = false;
		}
		if (isFourthStage && (posX == goombaPosX4 || goombaPosX4 == endPosX) && posY >= 170 && !goomba4Kill){
			gameNotOver = false;
		}
		if (!gameNotOver && displayEnd){
			gameOver();
			displayEnd = false;
		}

		if( (byte2 != 0xF0) && (byte3 == 0x5A) && !gameNotOver ){
			resetEverything();
			main();	
		}else if( (byte2 != 0xF0) && (byte3 == 0x76) && !gameNotOver){
			break;
		}
		if (isSecondStage && (posX <= goombaPosX && goombaPosX <= endPosX) && posY == 155){
			goomba1Kill = true;
			eraseG1 = true;
		}
		if (isThirdStage && (posX <= goombaPosX2 && goombaPosX2 <= endPosX) && posY == 155){
			goomba2Kill = true;
			eraseG2 = true;
		}
		if (isThirdStage && (posX <= goombaPosX3 && goombaPosX3 <= endPosX) && posY == 155){
			goomba3Kill = true;
			eraseG3 = true;
		}
		if (isFourthStage && (posX <= goombaPosX4 && goombaPosX4 <= endPosX) && posY == 155){
			goomba4Kill = true;
			eraseG4 = true;
		}

		if (gameNotOver){
			
			if (isSecondStage && !goomba1Kill ){
				moveGoomba1();
			}else if (eraseG1){
				finalScore += 50;
				eraseGoomba1();
				eraseG1 = false;
				goombaPosX = 0;
			}

			if (isThirdStage && !goomba2Kill ){
				moveGoomba2();
			}else if (eraseG2){
				finalScore += 50;
				eraseGoomba2();
				eraseG2 = false;
				goombaPosX2 = 0;
			}

			if (isThirdStage && !goomba3Kill ){
				moveGoomba3();
			}else if (eraseG3){
				finalScore += 50;
				eraseGoomba3();
				eraseG3 = false;
				goombaPosX3 = 0;
			}
			if (isFourthStage && !goomba4Kill ){
				moveGoomba4();
			}else if (eraseG4){
				finalScore += 50;
				eraseGoomba4();
				eraseG4 = false;
				goombaPosX4 = 0;
			}
			if ( (byte2 != 0xF0) && (byte3 == 0x23) )
			{
				pressedKey = 0x23;
				if ((endPosX == 54 && posY > 148 && isSecondStage) || (endPosX == 234 && posY > 148 && isSecondStage) || (endPosX == 170 && posY > 148 && isThirdStage) ){
					;
				}
				else{
					finalScore += 1;
					moveMarioRight();
					if (posY < 180){
						finalScore -= 1;
					}
				}					
			}
			if ( (byte2 != 0xF0) && (byte3 == 0x1D) )
			{
				pressedKey = 0x10;
				moveMarioUp();
				if (posY < 180){
					finalScore -= 1;
				}
			}
			if ( (byte2 != 0xF0) && (byte3 == 0x1B) )
			{
				pressedKey = 0x10;
				if (posY<180){
					if ((posY == 148 && (endPosX >= 54 && endPosX <= 110) && isSecondStage) || (posY == 148 && (endPosX >= 234 && endPosX <= 290) && isSecondStage)  || (posY == 148 && (endPosX >= 170 && endPosX <= 226) && isThirdStage) || (posY == 148 && (endPosX >= 200 && endPosX <= 256) && isThirdStage)){
						;
					}
					else{
						moveMarioDown();
						if (posY < 180){
							finalScore -= 1;
						}
					}
				}
			}
			if ( (byte2 != 0xF0) && (byte3 == 0x1C) )
			{
				pressedKey = 0x1C;
				if (posX-1 > 0){
					if ((endPosX == 115 && posY > 148 && isSecondStage) || (endPosX == 295 && posY > 148 && isSecondStage) || (endPosX == 261 && posY > 148 && isSecondStage)){
						;
					}
					else{
						finalScore -= 1;
						moveMarioLeft();
						if (posY < 180){
							finalScore -= 1;
						}
					}
				}
			}
		}	
	}
    return 0;
}

