void gameOver(){
	int x,y;
	for (x = 0; x < 320; x++){
		for (y =0; y<240; y++){
			plot_pixel(x,y,	0x0);
		}
	}
	for (x = 100;x < 200; x++){
		for (y = 50; y < 150; y++){
			plot_pixel(x,y,GameOver[y-50][x-100]);
		}
	}

	for (x = 100;x < 212; x++){
		for (y = 160; y < 210; y++){
			plot_pixel(x,y,Score[y-160][x-100]);
		}
	}
	int hundredth = (finalScore % 1000)/100;
	int tenth = (finalScore / 10)%10;
	int oneth = finalScore % 10;
	choosingNumber(hundredth);
	for (x = 130;x < 142; x++){
		for (y = 200; y < 215; y++){
			plot_pixel(x,y,numChoose[y-200][x-130]);
		}
	}
	choosingNumber(tenth);
	for (x = 147;x < 159; x++){
		for (y = 200; y < 215; y++){
			plot_pixel(x,y,numChoose[y-200][x-147]);
		}
	}
	choosingNumber(oneth);
	for (x = 164;x < 176; x++){
		for (y = 200; y < 215; y++){
			plot_pixel(x,y,numChoose[y-200][x-164]);
		}
	}
	printf("Press Enter to restart and ESC to close");
	return;
}
