void makePlatform(){
	int x = 0;
	while (x < 320){
		int j,k;
		for (j = 180;j < 210; j++){
			for (k = 0; k < 30; k++){
				plot_pixel(x+k,j,platform[j-180][k]);
			}
		}
		for (j = 210;j < 240; j++){
			for (k = 0; k < 30; k++){
				plot_pixel(x+k,j,platform[j-210][k]);
			}
		}
		x+=30;
	}
}
